import React from 'react';
import './App.css';
import { Home } from './components/Home.js';
import AboutUs from './components/AboutUs.js';
import Brochure from './components/Brochure.js';
import Testimonial from './components/Testimonial.js';
import ContactUs from './components/ContactUs.js';
import Support from './components/Support.js';
import Babyshower from './Services/components/Babyshower.js';
import EventPhotos from './Services/components/EventPhotos.js';
import FashionPhotography from './Services/components/FashionPhotography.js';
import Maternity from './Services/components/Maternity.js';
import PreWedding from './Services/components/PreWedding.js';
import ProductPhotoshoot from './Services/components/ProductPhotoshoot.js';
import Wedding from './Services/components/Wedding.js';
import { Route , Switch} from 'react-router-dom';

const App = () => {
  return(
    
        <Switch>
          <Route exact path="/" component={Home}/>
          
          <Route path="/aboutus" component={AboutUs}/>

          <Route path="/brochure" component={Brochure}/>

          <Route path="/testimonial" component={Testimonial}/>

          <Route path="/contactus" component={ContactUs}/>

          <Route path="/Support" component={Support}/>

          <Route path="/babyshower" component={Babyshower}/>
          <Route path="/EventPhotos" component={EventPhotos}/>
          <Route path="/FashionPhotography" component={FashionPhotography}/>
          <Route path="/Maternity" component={Maternity}/>
          <Route path="/PreWedding" component={PreWedding}/>
          <Route path="/ProductPhotoshoot" component={ProductPhotoshoot}/>
          <Route path="/Wedding" component={Wedding}/>
          
          <Route component={Error} />
        </Switch>
    
    // <div>
    //  <Home/>
    // </div>
  );
}

export default App;
